import { Routes, Route } from 'react-router-dom';

import DemoComponent from "./DemoComponent";
import DemoComponent2 from "./DemoComponent2";
import DemoComponent3 from "./DemoComponent3";
import DemoComponent4 from "./DemoComponent4";
import DemoComponent5 from "./DemoComponent5";
import Spinner from "./Spinner"
import DemoComponent7 from "./DemoComponent7";


const App = () => (

  <Routes>
    <Route path="/" element={<DemoComponent />}></Route>
    <Route path="/DemoComponent2" element={<DemoComponent2 />}></Route>
    <Route path="/DemoComponent3" element={<DemoComponent3 />}></Route>
    <Route path="/DemoComponent4" element={<DemoComponent4 />}></Route>
    <Route path="/DemoComponent5" element={<DemoComponent5 />}></Route>
    <Route path="/spinner" element={<Spinner />}></Route>
    <Route path="/DemoComponent7" element={<DemoComponent7 />}></Route>
  </Routes>
);

export default App;
